script: |
  super -f text -I q5665.spq | sort > q5665.out

inputs:
  - name: q5665.spq
    data: |
      SELECT DISTINCT - col2 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE col2 + + col0 / - col1 NOT BETWEEN NULL AND - + col0;
  - name: tab0

outputs:
  - name: q5665.out
    data: |
      -10
      -47
      -99
